export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:d,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:d,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:d,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},WxeEvBgbxi:{data:{id:537,attributes:{imdbId:"tt0074285",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTlhNmVkZGUtNjdjOC00YWY3LTljZWQtMTY1YWFhNGYwNDQwXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg",type:d,ratings:[{Source:"Internet Movie Database",Value:"7.4\u002F10"},{Source:"Rotten Tomatoes",Value:"93%"},{Source:"Metacritic",Value:"85\u002F100"}],item_lang:{data:{id:1200,attributes:{title:a,plot:"It's nearing the end of the school year. High school senior Carrie White is a social outcast, largely due to being unwise to the ways of the world based on her upbringing. Her mother, Margaret White, is a religious fanatic, her extreme views primarily targeted against sex, which she believes is a sin. She even believes natural associated processes such as menstruation are a sin, about which she has refused to mention to Carrie. Mrs. White's beliefs were taken to that extreme largely because of her own failed marriage and her husband Ralph long ago having run off with another woman. The only adult authority figure who tries to help Carrie with her life is her phys ed teacher, Miss Collins, who is nonetheless warned not to get too close to go against how Mrs. White chooses to raise Carrie, Mrs. White whose beliefs are well known in the community. An impromptu event that happens among Carrie's phys ed classmates against her leads to her classmates being punished. One of those students, self absorbed Chris Hargensen, vows revenge against Carrie for that punishment, the method of the revenge associated to the phys ed class incident. Another student however, the popular Sue Snell, begins to feel sorry for Carrie. In wanting to help her get out of her shell, Sue asks her boyfriend, the equally popular Tommy Ross, to take Carrie to the senior prom instead of her. This move does not sit well with Mrs. White, who in her extreme view believes Carrie will fall prey to sin. All these competing issues lead to Carrie deciding on an impulse to use a newfound skill to free herself from the figurative chains that have long been placed around her, with tragic consequences.",slug:"carrie"}}},books:{data:[{id:3942,attributes:{title:a,description:"El escalofriante caso de una joven de apariencia insignificante que se transformo en un ser de poderes anormales, sembrando el terror en la ciudad. Con pulso magico para mantener la tension a lo largo de todo el libro, Stephen King narra la atormentada adolescencia de Carrie, y nos envuelve en una atmosfera sobrecogedora cuando la muchacha realiza una serie de descubrimientos hasta llegar al terrible momento de la venganza. Esta novela fue llevada al cine con un inmenso exito de publico y critica.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6nZ9PwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c,h],firstBook:true,published:"2006-01-01",publisher:"Plaza Y Janes Mexico",subtitle:b}},{id:3943,attributes:{title:a,description:"An introverted girl with remarkable powers of telekinesis faces the horrors of teenage life and unleashes a few horrors of her own when she attends the high school prom",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=DP_XAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:e,published:"1975-01-01",publisher:"Berkley",subtitle:b}},{id:3944,attributes:{title:a,description:"Stephen King's legendary debut, the bestselling smash hit that put him on the map as one of America's favorite writers \"Gory and horrifying. . . . You can't put it down.\" —Chicago Tribune Unpopular at school and subjected to her mother's religious fanaticism at home, Carrie White does not have it easy. But while she may be picked on by her classmates, she has a gift she's kept secret since she was a little girl: she can move things with her mind. Doors lock. Candles fall. Her ability has been both a power and a problem. And when she finds herself the recipient of a sudden act of kindness, Carrie feels like she's finally been given a chance to be normal. She hopes that the nightmare of her classmates' vicious taunts is over . . . but an unexpected and cruel prank turns her gift into a weapon of horror so destructive that the town may never recover.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=FNxGvn1SCVMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:e,published:"2008-06-24",publisher:"Anchor",subtitle:b}},{id:3945,attributes:{title:a,description:"A dix-sept ans, solitaire, timide et pas vraiment jolie, Carrie White vit un calvaire, victime du fanatisme religieux de sa mère et des moqueries incessantes de ses camarades de classe. Sans compter ce don, cet étrange pouvoir de déplacer les objets à distance, bien qu'elle le maîtrise encore avec difficulté... Un jour, cependant, la chance paraît lui sourire. Tommy Ross, le seul garçon qui semble la comprendre et l'aimer, l'invite au bal de printemps de l'école. Une marque d'attention qu'elle n'aurait jamais espérée, et peut-être même le signe d'un renouveau ! Loin d'être la souillonne que tous fustigent, elle resplendit et se sent renaître à la vie. Mais c'est compter sans l'aigreur et la mesquinerie des autres élèves. Cette invitation, trop belle pour être vraie, ne cache-t-elle pas un piège plus cruel encore que les autres ?",thumbnail:b,authors:[c],firstBook:e,published:"2001-01-01",publisher:"J'ai lu",subtitle:b}},{id:3946,attributes:{title:a,description:"El escalofriante caso de una joven en apariencia insignificante que se transformó en un ser de poderes anormales, sembrando el terror en su ciudad. Con pulo mágico para mantener la tensión a lo largo de todo el libro, Stephen King narra la atormentada adolescencia de Carrie, y nos envuelve en una atmósfera sobrecogedora cuando la muchacha realiza una seie de descubrimientos hasta llegar al terrible momento de la vengaza. esta novela fue llevada al cina y obtuvo un imenso éxito de público y de crítica.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Nkv1T2ZyN-0C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c,h],firstBook:e,published:"2001-09-01",publisher:"Plaza y Janes",subtitle:b}}]}}},meta:{}}},prerenderedAt:1681703505957}}("Carrie","","Stephen King","movie",null,"series",1,"Gregorio Vlastelica"))